import React, { Component } from 'react';
import Hamburger from './Nav';
import { connect } from 'react-redux';
import * as actionCreator from './Store/Actions/actions';
class MYtinerary extends Component {
    constructor(){
        super()
        this.state ={
            showItinerary:[]
        }
    }
    render() {
        return (
            <div>
                <Hamburger />
                {/* <h1>MYtinerary</h1> */}
                <p>Available MYtineraries</p>
                <p>{this.props.itineraries}</p>
                <div>
                    {/* <img src={} alt="user"></img> */}
                </div>
            </div>

        );
    }
    componentDidMount(){
        this.props.fetchItineraries();
    }
}

const mapStateToProps =(state)=>{
    return {
        itineraries: state.itineraries
    }
}
const mapDispatchToProps =(dispatch)=>{
    return {
        fetchItineraries: ()=>{
            dispatch(actionCreator.fetchItineraries())
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(MYtinerary);
